import React from 'react';
import {BrowserRouter, Route} from 'react-router-dom';



export default class Sign extends React.Component{
    render(){
        return (<BrowserRouter><div>

                                       
             <Route path="/sign" exact component={Sign}/>
                                   
               
                    <h1>Sign Up</h1>
        </div>
        </BrowserRouter>);
    }
}
